VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'essure falls. This is called diastolic pressure. Your blood pressure reading uses these two numbers. Usually the systolic number comes before or above the diastolic number. For example, 120/80 means a systolic of 120 and a diastolic of 80. How is high blood pressure diagnosed? High blood pressure usually has no symptoms. So the only way to find out if you have it is to get regular blood pressure checks from your health care provider. Your provider will use a gauge, a stethoscope or electronic sensor, and a blood pressure cuff. They will take two or more readings at separate appointments before making a diagnosis.', '{0.4508848190307617,-0.28261205554008484,-0.16783064603805542,-0.4835662543773651,-0.3621739149093628,0.16705214977264404,-0.0014855642803013325,0.45906513929367065,0.46414127945899963,-0.7075477838516235,0.2891924977302551,0.19629625976085663,-0.5345795750617981,-0.7744096517562866,-1.1237341165542603,0.4678419828414917,0.6829448342323303,0.2803826928138733,-0.6986618041992188,0.20430316030979156,-0.6550208330154419,-0.797778844833374,-0.6547636985778809,-0.3094874918460846,1.2535239458084106,-0.5824333429336548,0.5170984864234924,-1.1096652746200562,-0.8087896704673767,0.5038648843765259,-0.6462022066116333,-0.7586872577667236,0.14083527028560638,0.35244810581207275,-0.293782114982605,-0.07258859276771545,-0.3444664478302002,1.6226779222488403,0.36539098620414734,-0.057191796600818634,-0.7623541355133057,0.14419585466384888,-0.30367639660835266,-0.708989143371582,-0.033435236662626266,0.23137421905994415,0.012628162279725075,-0.030576899647712708,0.627600908279419,0.2589713931083679,-0.36957526206970215,-0.10856285691261292,-0.7689298391342163,0.5051808953285217,0.850784182548523,0.43141788244247437,-0.495008260011673,-0.391563355922699,-0.34946098923683167,0.5893425345420837,-0.23243233561515808,0.40510350465774536,0.15379275381565094,-0.4426589906215668,-0.07119451463222504,-0.21