VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'essure. For most people who get this kind of blood pressure, it develops over time as you get older. Secondary high blood pressure is caused by another medical condition or use of certain medicines. It usually gets better after you treat that condition or stop taking the medicines that are causing it. Why do I need to worry about high blood pressure? When your blood pressure stays high over time, it causes the heart to pump harder and work overtime, possibly leading to serious health problems such as heart attack, stroke, heart failure, and kidney failure. What are the treatments for high blood pressure? Treatments for high blood pressure include heart-healthy lifestyle changes and medicines. You will work with your provider to come up with a treatment plan. It may include only the lifestyle changes. These changes, such as heart-healthy eating and exercise, can be very effective. But sometimes the changes do not control or lower your high blood pressure.', '{0.5868876576423645,-0.0714091882109642,-0.07699823379516602,-0.25874534249305725,0.09810551255941391,0.4610666334629059,0.14078184962272644,0.4924742579460144,0.40224915742874146,-0.9741472005844116,0.49258658289909363,0.08224495500326157,-0.40565022826194763,-1.0343669652938843,-1.2194167375564575,0.6403481960296631,0.6390630602836609,0.3130823075771332,-0.6132691502571106,0.13985516130924225,-0.6708683967590332,-0.6696874499320984,-0.5482993721961975,-0.13680721819400787,0.6695777177810669,-0.5483734607696533,0.32525771856307983,-0.9385520219802856,-0.7365725040435791,0.5879678726196289,-0.5717644095420837,-0.8717570304870605,0.5942147374153137,0.5663230419158936,0.08034589141607285,0.21235741674900055,-0.38769710063934326,1.526597023010254,0.26756271719932556,-0.24508732557296753,-0.3863755166530609,-0.21492166817188263,-0.1342540681362152,-0.577329695224762,0.0027267667464911938,-0.2492438405752182,-0.1136627122759819,0.11875135451555252