VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'ue. Plaque sticks to the walls of your arteries. This buildup of plaque is known as atherosclerosis. It can lead to coronary artery disease, a condition in which your coronary arteries become narrow or even blocked. What are HDL, LDL, and VLDL? HDL, LDL, and VLDL are lipoproteins. They are a combination of fat (lipid) and protein. The lipids need to be attached to the proteins so they can move through the blood. Different types of lipoproteins have different purposes: HDL stands for high-density lipoprotein. It is sometimes called "good" cholesterol because it helps your body get rid of cholesterol. It carries cholesterol from other parts of your body back to your liver. Your liver then removes the cholesterol from your body. LDL stands for low-density lipoprotein. It is sometimes called "bad" cholesterol because a high LDL level leads to the buildup of plaque in your arteries. VLDL stands for very low-density lipoprotein.', '{0.552748441696167,0.5417035222053528,0.061393022537231445,0.1614600270986557,-0.004310737829655409,0.4388164281845093,0.18050973117351532,0.5203844308853149,0.1888483762741089,-0.16604585945606232,0.08923107385635376,0.35691317915916443,-0.20956073701381683,-0.2099364548921585,-0.6800417900085449,0.10669561475515366,0.05179305747151375,-0.7391923069953918,0.04772273078560829,0.008546005003154278,-0.17308318614959717,-0.38127413392066956,0.20813556015491486,-0.5487479567527771,0.2563769817352295,0.2621851861476898,-0.34428825974464417,-0.4955309331417084,-0.467902809381485,-0.31733429431915283,-0.41567620635032654,0.2761215269565582,-0.6868589520454407,0.017645707353949547,-0.11463439464569092,-0.705327570438385,-0.08345266431570053,0.2901029586791992,-0.28689196705818176,0.46757349371910095,-0.2967224419116974,0.5171886086463928,0.6129103899002075,0.0360504575073719,-0.23697447776794434,-0.3807621896266937,-0.0737825483083725,0.9618107676506042,0.4560302793979645,0.3625842