VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'level leads to the buildup of plaque in your arteries. VLDL stands for very low-density lipoprotein. Some people also call VLDL a "bad" cholesterol because it too contributes to the buildup of plaque in your arteries. But VLDL and LDL are different; VLDL mainly carries triglycerides and LDL mainly carries cholesterol. What causes high cholesterol? The most common cause of high cholesterol is an unhealthy lifestyle. This can include: Unhealthy eating habits, such as eating lots of saturated fats. These fats are found in red meats, full-fat dairy products, chocolate, some baked goods, and many deep-fried and processed foods. Eating too much saturated fat can raise your LDL (bad) cholesterol. Lack of physical activity, with lots of sitting and little exercise. This lowers your HDL (good) cholesterol. Smoking, which lowers HDL cholesterol, especially in women. It also raises your LDL cholesterol. Stress, which may raise levels of certain hormones such as corticosteroids.', '{0.8700982332229614,0.22194130718708038,-0.08743397891521454,0.10054260492324829,0.148161381483078,0.8829681873321533,-0.07585981488227844,0.5625868439674377,0.20541004836559296,-0.18905285000801086,0.3494134843349457,0.3433650732040405,-0.26286986470222473,-0.02682219073176384,-0.6884865164756775,-0.014264695346355438,0.030155541375279427,-0.29644250869750977,0.07684376835823059,-0.20899079740047455,-0.18389596045017242,-0.30665576457977295,0.20619358122348785,-0.5053059458732605,0.05044391006231308,0.41321200132369995,-0.23807255923748016,-0.76856529712677,-0.7794423699378967,-0.4403490126132965,-0.33208006620407104,0.28378599882125854,-0.337809681892395,0.11120188981294632,-0.04871376231312752,-0.32634463906288147,0.041689857840538025,0.425826758146286,0.19296817481517792,0.2192714512348175,-0.5188474059104919,0.41215255856513977,0.5881814956665039,0.028135742992162704,-0.3685374855995178,-0.28777313232421875,-0.12462994456291