VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 've a greater risk of high total cholesterol than women. But after menopause, a woman''s risk goes up. This happens because menopause lowers levels of female hormones that may protect against high blood cholesterol. Family history. High blood cholesterol can run in families. Other health conditions. Conditions such as diabetes, chronic kidney disease, HIV, and lupus can raise your risk of high cholesterol. Medicines. Certain medicines can raise your level of LDL cholesterol or lower your level of HDL cholesterol, including: Steroids Some chemotherapy medicines Medicines taken after an organ transplant Medicines for certain heart conditions Certain acne medicines Race or ethnicity. People from certain racial or ethnic groups may have an increased risk of high cholesterol. For example, Asian Americans are more likely to have high levels of LDL cholesterol than other groups. And non-Hispanic White people are more likely than other groups to have high levels of total cholesterol. Weight.', '{0.28593260049819946,0.20781908929347992,-0.023653218522667885,-0.22235098481178284,0.10133355110883713,1.0978432893753052,0.3030729591846466,0.6034116744995117,0.3108503222465515,-0.6599923372268677,0.22193081676959991,0.7939881682395935,0.084656722843647,-0.10568106919527054,-0.16501352190971375,0.03471936285495758,-0.10577519237995148,0.05698947235941887,-0.029210694134235382,-0.6340931057929993,-0.30879589915275574,-0.3423432409763336,-0.09750340133905411,-0.13296963274478912,-0.1990789771080017,-0.010082947090268135,-0.5200773477554321,-0.7146795392036438,-1.0068461894989014,-0.6239179968833923,-0.47861987352371216,-0.04538377374410629,0.18035516142845154,0.37451866269111633,-0.10069536417722702,0.4495454430580139,-0.001091936370357871,0.6956159472465515,-0.09766478091478348,-0.4849473834037781,-0.20753873884677887,0.6425456404685974,0.6671851277351379,-0.4356759786605835,-0.5794766545295715,-0.32458814978599