VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 5, 'nic White people are more likely than other groups to have high levels of total cholesterol. Weight. Being overweight or having obesity raises your cholesterol level. What other health problems can high cholesterol cause? Undiagnosed or untreated high blood cholesterol can lead to serious health problems: If you have large deposits of plaque in your arteries, an area of plaque can rupture (break open). This can cause a blood clot to form on the surface of the plaque. If the clot becomes large enough, it can mostly or completely block blood flow in a coronary artery. If the flow of oxygen-rich blood to your heart muscle is reduced or blocked, it can cause angina (chest pain) or a heart attack. Plaque also can build up in other arteries in your body, including the arteries that bring oxygen-rich blood to your brain and limbs. This can lead to problems such as carotid artery disease, stroke, and peripheral arterial disease. How is high cholesterol diagnosed?', '{0.7139373421669006,0.3096037805080414,0.14449091255664825,-0.1942073106765747,-0.08453409373760223,0.9399741888046265,0.1963755041360855,0.4387810230255127,-0.009161359630525112,-0.6976834535598755,0.011386100202798843,0.9851445555686951,-0.09875044971704483,-0.365238755941391,-0.43628889322280884,-0.005605529062449932,-0.535203218460083,-0.17195017635822296,-0.07481474429368973,-0.5247130393981934,-0.3287374973297119,-0.3003874123096466,-0.009603635407984257,-0.06871719658374786,-0.011482312344014645,0.06838604062795639,-0.46811896562576294,-0.7222980260848999,-0.5817293524742126,-0.24695803225040436,-0.4413660764694214,-0.30443161725997925,-0.25941184163093567,0.07478227466344833,-0.05763912573456764,-0.40794140100479126,0.14271722733974457,0.46145814657211304,-0.1521913856267929,0.03251754865050316,-0.23846611380577087,0.21922703087329865,0.7065480947494507,0.10673688352108002,0.0316811166703701,-0.3747847080230713,0.11879459768533707,0.