VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 6, 'carotid artery disease, stroke, and peripheral arterial disease. How is high cholesterol diagnosed? There are usually no signs or symptoms that you have high cholesterol. A blood test can measure your cholesterol levels. When and how often you should get this test depends on your age, risk factors, and family history. The general recommendations are: For people who are age 19 or younger:: The first test should be between ages 9 to 11 Children should have the test again every 5 years Some children may have this test starting at age 2 if there is a family history of high blood cholesterol, heart attack, or stroke For people who are ages 20 to 65:: Younger adults should have the test every 5 years Men ages 45 to 65 and women ages 55 to 65 should have it every 1 to 2 years For people over age 65: They should be tested every year How can I lower my cholesterol? You can lower your cholesterol through heart-healthy lifestyle changes.', '{0.2413686364889145,0.08019537478685379,-0.16099651157855988,-0.502592146396637,-0.1749255210161209,1.2676548957824707,0.0736686959862709,0.40923282504081726,0.26630541682243347,-0.30178478360176086,0.05262990668416023,1.1321353912353516,-0.25390446186065674,-0.5092214941978455,-0.5237154960632324,0.15741945803165436,-0.5548543334007263,-0.07989659160375595,-0.6091291904449463,0.02176518552005291,-0.08388231694698334,-0.9750617146492004,0.02824975736439228,-0.12659502029418945,0.04792264848947525,0.06368105858564377,0.07418730854988098,-0.731058657169342,-0.45298752188682556,-0.547487199306488,-0.13824144005775452,-0.2468201071023941,-0.0813826397061348,-0.19661347568035126,-0.3079259693622589,-0.09039489179849625,0.19153517484664917,0.5369935035705566,0.2680392563343048,-0.16614685952663422,-0.18960224092006683,0.4956234395503998,0.16182278096675873,-0.6008986830711365,-0.33280324935913086,0.20370618999004364,0.14967715740203857,0.29022324085235596,0.935962438583374,0.