VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 7, 'can I lower my cholesterol? You can lower your cholesterol through heart-healthy lifestyle changes. They include a heart-healthy eating plan, weight management, and regular physical activity. If the lifestyle changes alone do not lower your cholesterol enough, you may also need to take medicines. There are several types of cholesterol-lowering medicines available, including statins. If you take medicines to lower your cholesterol, you still should continue with the lifestyle changes. Some people with familial hypercholesterolemia (FH) may receive a treatment called lipoprotein apheresis. This treatment uses a filtering machine to remove LDL cholesterol from the blood. Then the machine returns the rest of the blood back to the person. NIH: National Heart, Lung, and Blood Institute Start Here Control Your Cholesterol: Protect Yourself from Heart Attack and Stroke (National Institutes of Health) Also in Spanish What Is Blood Cholesterol?', '{0.07847227901220322,0.6522891521453857,0.1010480746626854,-0.28383728861808777,0.16954492032527924,0.9456452131271362,0.1296042501926422,0.4633924067020416,0.1880349963903427,-0.7746259570121765,0.2162332981824875,0.8200651407241821,-0.12809079885482788,-0.6152229309082031,-0.14985257387161255,0.10408791899681091,-0.41808271408081055,-0.44178035855293274,-0.0305972620844841,-0.15074776113033295,-0.43254873156547546,-0.7671379446983337,0.04701558127999306,-0.39467495679855347,0.08290231227874756,0.1947864145040512,-0.1261083483695984,-0.3346957862377167,-0.48782289028167725,-0.3210451304912567,-0.3196571469306946,0.039538364857435226,0.07919154316186905,0.5109720826148987,-0.2351609319448471,-0.10415372252464294,-0.08656113594770432,0.34249866008758545,0.18534192442893982,0.14649458229541779,-0.11385707557201385,0.4721779525279999,0.23292334377765656,-0.0522090308368206,-0.14533069729804993,-0.9527454376220703,0.28252846002578735,0.1968601942062378,0.35847520828