VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'and water. The plan should also take into account your preferences, cultural traditions, and budget. Healthy eating does not mean that you have to follow a very strict diet or eat only a few specific types of food. It doesn''t mean that you can never eat your favorite foods. You can eat a variety of foods, including less healthy favorites. But it''s important not to eat too much of those foods or have them too often. You can balance those foods with healthier foods and regular physical activity. The keys to a healthy eating plan include: Eating a variety of foods, including vegetables, fruits, and whole-grain products Eating lean meats, poultry, fish, beans, and low-fat dairy products Getting enough fiber Drinking lots of water Limiting salt, added sugars, alcohol, and saturated fat Making sure that you get enough nutrients, especially calcium, vitamin D, and potassium Centers for Disease Control and Prevention Start Here 2020-2025 Dietary Guidelines for Americans (Department of Agricult', '{-0.17352727055549622,-0.13441288471221924,-0.4117043912410736,0.18874095380306244,0.6870888471603394,0.5166575908660889,-0.2489936351776123,0.8563136458396912,0.3074485659599304,0.013114340603351593,0.33838826417922974,0.48912549018859863,-0.31849297881126404,-1.0604196786880493,-0.9421355128288269,-0.016920236870646477,-0.32745203375816345,0.3684452176094055,-0.7148639559745789,-0.25353100895881653,-0.4480333626270294,0.1676638126373291,-0.17591902613639832,-0.3716724216938019,0.6788203120231628,-0.22181731462478638,-0.19360874593257904,-1.113608956336975,-0.18168656527996063,0.041511163115501404,-0.7655689716339111,0.022590873762965202,0.5354871153831482,-0.024486981332302094,-0.6179694533348083,-0.1899663656949997,0.13635684549808502,0.35058823227882385,0.16091151535511017,-0.5569440722465515,-0.38276612758636475,0.9730916023254395,-0.16204607486724854,0.035564277321100235,-0.49627169966697693,-0.05133301