VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Smoking Also called: Cigar smoking, Cigarette smoking, Pipe smoking, Tobacco smoking On this page Basics Summary Start Here Learn More Related Issues Specifics See, Play and Learn Health Check Tools Research Statistics and Research Clinical Trials Journal Articles Resources Reference Desk Find an Expert For You Women Patient Handouts Summary What are the health effects of smoking? There''s no way around it; smoking is bad for your health. It harms nearly every organ of the body, even some that you would not expect. Cigarette smoking causes many cancers and other health problems. It is also the cause of nearly one in five deaths in the United States. Some of the many health problems that smoking can cause include: Cancers. Smoking is the most common cause of lung and oral cancers. But it can also cause cancer in many other parts of your body, such as in your larynx (voice box), esophagus, throat, bladder, kidney, liver, stomach, pancreas, colon and rectum, and cervix.', '{0.4664872884750366,-0.4406762719154358,-0.28985950350761414,0.04603387787938118,0.8327248692512512,0.9956335425376892,-0.0906192809343338,0.5662990212440491,-0.15973791480064392,-0.311722069978714,0.2531742751598358,0.3493577837944031,-0.04681688919663429,-0.8653545379638672,-0.2959158420562744,-0.3315291404724121,0.7089323997497559,0.19505314528942108,0.4832909405231476,-0.4508456885814667,0.002936381846666336,0.06778562068939209,-0.5051895380020142,-0.15689009428024292,-0.337007075548172,0.14429929852485657,-0.6682032346725464,-0.2515471875667572,-0.1630697399377823,-0.3952830731868744,-0.7901606559753418,0.2666584849357605,-0.2908753454685211,0.3630343973636627,-0.23448751866817474,0.3544268310070038,-0.19107531011104584,1.338364601135254,0.37240609526634216,-0.1071314886212349,-0.06565070897340775,0.32603490352630615,-0.3583463728427887,0.41966983675956726,-0.4403877556324005,-0.12571857869625092,1.1214834451675415,-0.064932