VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'ce box), esophagus, throat, bladder, kidney, liver, stomach, pancreas, colon and rectum, and cervix. It can also cause acute myeloid leukemia (AML). Lung diseases. Smoking is the most common cause of COPD. It can also worsen asthma and raise your risk of pneumonia. Cardiovascular diseases. Smoking can damage your blood vessels and make them thicken and grow narrower. This makes your heart beat faster and raises your blood pressure. Smoking also increases your risk of blood clots and stroke. Vision problems. Smoking can raise your risk of cataracts and cause macular degeneration (AMD). You have a greater chance of certain pregnancy problems if you smoke while pregnant. Your baby is also at higher risk of dying of sudden infant death syndrome (SIDS). Smoking also causes addiction to nicotine, a stimulant drug that is in tobacco. Nicotine addiction makes it much harder for people to quit smoking. What are the health risks of secondhand smoke? Your smoke is also bad for other people.', '{0.46481722593307495,-0.5399258136749268,-0.2733211815357208,0.23047630488872528,0.9566632509231567,0.9947978854179382,-0.1728868931531906,0.1406799852848053,-0.2143813669681549,-0.5372215509414673,0.3632535934448242,0.33592161536216736,-0.18432343006134033,-0.7338400483131409,-0.5566422939300537,0.12854069471359253,0.4972459077835083,0.19972048699855804,0.32486921548843384,-0.5751708149909973,-0.25104010105133057,-0.2642086446285248,-0.22771528363227844,-0.11442017555236816,-0.6365303993225098,0.2880314886569977,-0.46133604645729065,-0.25905412435531616,-0.26650941371917725,-0.07010301947593689,-0.8240762948989868,0.24203291535377502,-0.3285808861255646,0.6612190008163452,0.03020949475467205,0.2519824206829071,-0.038055744022130966,1.415346622467041,0.054557640105485916,-0.31541192531585693,-0.4208465814590454,-0.2095262110233307,-0.02485930547118187,0.03847262263298035,-0.6436645984649658,0.0020487892907112837,0.78