VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'uit smoking. What are the health risks of secondhand smoke? Your smoke is also bad for other people. If they breathe in your secondhand smoke, they can get many of the same problems as smokers do. These problems can include heart disease and lung cancer. Children exposed to secondhand smoke have a higher risk of ear infections, colds, pneumonia, bronchitis, and more severe asthma. If you breathe secondhand smoke while pregnant, you''re more likely to have preterm labor and a baby with low birth weight. Are other forms of tobacco also dangerous? Besides cigarettes, there are several other forms of tobacco. Some people smoke tobacco in cigars and water pipes (hookahs). These forms of tobacco also contain harmful chemicals and nicotine. Some cigars contain as much tobacco as an entire pack of cigarettes. E-cigarettes often look like cigarettes, but they work differently. They are battery-operated smoking devices. Using an e-cigarette is called vaping.', '{0.7679646611213684,-0.31013891100883484,-0.2970450520515442,0.3061351180076599,1.0270946025848389,0.9876431226730347,-0.40680497884750366,0.252646803855896,0.29424500465393066,-0.22755677998065948,0.617450475692749,0.2714080214500427,-0.30192068219184875,-0.45283016562461853,-0.38962796330451965,-0.030490096658468246,0.7679674029350281,0.059205811470746994,0.2020515352487564,-0.8313339352607727,-0.309400349855423,-0.22987845540046692,-0.6160649061203003,-0.027131929993629456,-0.3743157684803009,0.3416965901851654,-0.057450924068689346,-0.18515773117542267,-0.039906613528728485,-0.29320859909057617,-0.8229439854621887,0.3258296847343445,-0.24494722485542297,0.8256269693374634,-0.03621189668774605,0.3204367756843567,-0.4497775733470917,1.2608752250671387,0.3746873140335083,0.0030296456534415483,-0.34920939803123474,0.09322156757116318,-0.09153195470571518,-0.017502030357718468,-0.5873433351516724,0.13799506425857544,0.9941508769989014,-0.06490427255